INSERT INTO `posts` (`id`, `title`, `body`, `modified_date`, `image_content`, `image_size`, `image_name`, `image_type`, `archive`, `created_date`) VALUES
(42, 'How To Say No, And Other Tips From Inside SRIâ€™s Venture Process', 'Editorâ€™s note: Norman Winarsky is the Vice President of Ventures at research and technology development organization SRI International, and a visiting scholar at Stanford University. He is co-founder of Siri, and more than 30 other ventures.\r\n\r\nI am frequently asked what SRI International thinks about the explosion of incubators in the United States and abroad and how our approach to creating new ventures compares.\r\n\r\nSRI has one of the longest and best track records creating new technologies and innovations, and we have formed more than 50 new ventures in the last 20 years. But weâ€™re also known for taking a contrarian position on some of the ideas about incubation, commercialization and innovation. Our greatest successes, such as the founding of companies Nuance, Intuitive Surgical, Orchid Biosciences, and Siri prove our mettle. Weâ€™ve had our share of failures, too.\r\n\r\nWhat have we learned over more than 65 years of invention and commercialization? How can one create the greatest amount of value possible in a new company? There are several specific ways in which our venture processes stand in contrast to what is in vogue today. These are lessons that anyone in the business of innovation should consider.\r\n\r\n', NULL, , 14553, 'super_bowl_xlvii_logo.gif', 'image/gif', 0, '2013-02-03 12:47:00');
INSERT INTO `posts` (`id`, `title`, `body`, `modified_date`, `image_content`, `image_size`, `image_name`, `image_type`, `archive`, `created_date`) VALUES
(43, 'Cloud Latency Issues? Dedicated Network Connections Will Help', 'Editorâ€™s note: Jelle Frank van der Zwet is Segment Marketing Manager, Cloud, for Interxion, and David Strom is a freelance writer. \r\n\r\nDo you ever encounter delays in loading web-based applications and get impatient? Resulting from poor network latency, or how fast data is transferred from one location to another, these delays are frustrating to as end users, but are far more costly to Internet businesses that depend on lightning-quick web experiences for their customers. With the proliferation of cloud computing placing added demands on Internet speed and connectivity, latency is becoming a more critical concern for everyone, from the end user to the enterprise.\r\n\r\nPre-Internet, latency was characterized by the number of router hops between you and your application, and the delay that packets took to get from source to destination. For the most part, your corporation owned all of the intervening routers, so network delays remained fairly consistent and predictable. As businesses migrate and deploy more and more applications to the cloud, the issue of latency is becoming increasingly complex. In order to leverage cloud computing as a true business enabler, it is critical that organizations learn how to manage and reduce latency.\r\n\r\nThe first step in reducing latency is to identify its causes. To do this, we must examine latency not as it relates to the web, but as it relates to the inherent components of cloud computing. After some analysis, youâ€™ll see that it isnâ€™t just poor latency in the cloud but the unpredictable nature of the various network connections between on-premise and cloud applications that can cause problems. Weâ€™ve provided below five layers of complexity that are unpredictable in nature and must therefore be considered when migrating applications to the cloud.\r\n\r\n', NULL, , 8492, 'logo.jpg', 'image/jpeg', 0, '2013-02-03 12:47:08'),
(44, 'sd', 'sdsds', NULL, , 8492, 'logo.jpg', 'image/jpeg', 1, '2013-02-03 18:36:44'),
(45, 'Chrome Isue', 'Google Chrome: Could Not Load Shockwave Flash\r\n\r\nPosted by cumptrnrd on September 5, 2012\r\nI recently started getting this error on my MacBook, but had no idea why.  I hoped it would fix itself with a Chrome update or something, but that never happened.  I didnâ€™t really mind since the only change to me was that the fan on my MacBook Air wasnâ€™t kicking in whenever I was on a site with a Flash ad.\r\n\r\nThis finally affected me negatively when I was trying to upload some photos to print at Walgreens.com.  I got the yellow error banner stating, â€œCould Not Load Shockwave Flash.â€  After delving into the issue, I discovered this fix:\r\n\r\nIn the address bar, go to chrome://plugins\r\nIf you have the same issue I did, you should see â€œFlash (2 files)â€¦â€ listed.  When you click the Details button in the top-right corner to expand all the entries, you should now see two entries under the â€œFlash (2 files)â€¦â€ heading.\r\nDisable the Flash plugin internal to Chrome (the Location entry should be something like /Applications/Google Chrome.app...\r\nRefresh your page!', NULL, , 3972, 'logo_sm.gif', 'image/gif', 0, '2013-02-03 18:38:45');
INSERT INTO `posts` (`id`, `title`, `body`, `modified_date`, `image_content`, `image_size`, `image_name`, `image_type`, `archive`, `created_date`) VALUES
(46, 'Telefonica Digital Acquires Controlling Stake In Brazilâ€™s Axismed, Its First Move Into E-Health So', 'Telefonica Digital, the tech arm of carrier giant Telefonica, has been making a lot of consumer-focused acquisitions and investments in the last year â€” and now itâ€™s showing that it has an equal interest in enterprise verticals, specifically in e-health: today it announced the acquisition of a controlling stake in Axismed, a chronic care management provider based in Brazil. Financial terms of the deal were not disclosed.\r\n\r\nA spokesperson from Telefonica told TechCrunch that this is the carrierâ€™s first investment into e-health, and that the enterprise will continue to remain a focus for Telefonica Digital investments, alongside more consumer-service-focused investments like its stakes in app search Everything.me and mobile payments startup Boku; its acquisition of video chatting platform Tokbox; and more.\r\n\r\nâ€œThe deal is part of the companyâ€™s global strategy to focus on the e-health market, which is one of a number of areas in which TelefÃ³nica Digital is developing new innovative products and services,â€ Antonio Carlos Valente, CEO of the TelefÃ³nica Group in Brazil, said in a statement.\r\n\r\nThe first intention with 10-year old Axismed, Telefonica says, will be to expand the monitoring service across all of Brazil, and then move it into other markets. In total Telefonica has services in 25 countries, covering 314 million customers.\r\n\r\nAxismed already works with healthcare providers in the country to help monitor some 180,000 outpatients. Telefonica has a 90-million customer base in the country through its Vivo subsidiary, and the idea will be to integrate Axismed into Vivoâ€™s infrastructure to contact and monitor patients using mobile apps, SMS, video streams, and so on, to cover biometric data around glucose levels, blood pressure, and so on. Brazilâ€™s National Health Agency ANS says there are some 48 million people in the country taking some form of supplementary healthcare on top of state plans, and the private companies that serve these patients will be target one, before Telefonica looks to take the solution to other markets outside of Brazil with the promise of reducing healthcare costs.', NULL, , 13349, 'screen-shot-2013-02-04-at-06-57-22.png', 'image/png', 0, '2013-02-04 15:47:50');
INSERT INTO `posts` (`id`, `title`, `body`, `modified_date`, `image_content`, `image_size`, `image_name`, `image_type`, `archive`, `created_date`) VALUES
(47, 'Twitch Launches $8.99 Per Month Premium Tier, With Custom Emoticons, Badgesâ€¦ And No Ads', 'Ever since it was launched in 2011, e-sports streaming specialist Twitch has been free to view. Like other streaming video sites on the web, Twitch has relied on ads as its primary source of monetization. But frankly, no one likes ads, and so the company is rolling out a new premium tier, called Twitch Turbo, which will provide ad-free viewing, as well as a few other features, for $8.99 a month.\r\n\r\nTurbo users will be able to freely stream all their favorite e-sports events, matches, and tutorials, all without any pre-rolls or overlays. But there are other advantages to being a Turbo user â€” most notably, improved chat features. Paying for Turbo means having a whole new set of colors and emoticons to use during chat. Theyâ€™ll also get priority customer support, as well as a badge which recognizes them as a paying subscriber.\r\n\r\nIn an email, Twitch VP of marketing Matt DiPietro wrote that the Turbo offering came after extensive research from users about what features theyâ€™d want and what theyâ€™d be willing to pay for. Chat was one of the features that users enjoyed and wanted more flexibility around, and the company expects that part of the offer to be popular.\r\n\r\nSurprisingly enough, there was actually some concern among users surveyed about a reduction in monetization for Twitch broadcasters if ads were stripped out. But DiPietro wrote that its streaming partners will continue to get paid for impressions that come from Turbo users, even if no ads are shown.', NULL, , 578768, 'twitch_logo.jpg', 'image/jpeg', 0, '2013-02-04 15:49:22');
INSERT INTO `posts` (`id`, `title`, `body`, `modified_date`, `image_content`, `image_size`, `image_name`, `image_type`, `archive`, `created_date`) VALUES
(48, 'Superbowl Ad Confirms BlackBerry 10 Canâ€™t Turn Trucks Into Rubber Duckies', 'BlackBerry 10â€²s first Superbowl commercial squeaked in right before a power outage delayed the game for 34 minutes. Instead of focusing on what the new OS can do, however, the 30-second spot showed what it canâ€™t do: trigger spontaneous combustion, make users disappear in a puff of colorful smoke and then magically reappear out of manholes, or turn out-of-control tanker trucks into a giant, harmless pile of rubber ducks.', NULL, , 20416, '517503644_3_o1.jpg', 'image/jpeg', 0, '2013-02-04 15:50:30');
INSERT INTO `posts` (`id`, `title`, `body`, `modified_date`, `image_content`, `image_size`, `image_name`, `image_type`, `archive`, `created_date`) VALUES
(49, 'Ravens Fans Are 14% More Likely To Fumble Their Smartphones During The Super Bowl Than 49ers Fans', 'Itâ€™s Super Bowl Sunday, and the anticipation is palpable. I canâ€™t speak for Baltimore, but on my recent trip to San Francisco, I realized I had never seen such a large congregation of people all wearing a single teamâ€™s merchandise. But all the excitement of the big game, combined with quite a bit of alcohol, actually makes for a relatively dangerous situation for your phone.\r\n\r\nIn fact, a new report from SquareTrade (a company that offers extended warranties for smartphones) claims that 27 percent of Ravens fans have dropped and damaged their phones in the past 12 months, while 23 percent of 49ers fans have had an accident.\r\n\r\nAccording to the study, Ravens fans are actually more at risk of damaging their smartphones or tablets during the big game; SquareTrade says they are 14 percent clumsier than their Super Bowl counterparts in San Francisco.\r\n\r\nOf all the spectator-sports-related accidents coming through SquareTradeâ€™s protection-plan system, 18 percent of phone drops are what the firm calls â€œliquid drops,â€ meaning the phone ends up in the toilet, a puddle of spilled beverage, etc. Shockingly, 13 percent of all drops are phones plopped into beer. Just goes to show that drunkenness and gadget operation do not go hand-in-hand.\r\n\r\nFollowed shortly behind that, 12 percent of all spectator-sport accidents happen during a fit of rage or passion, where a device is straight up thrown across the room.\r\n\r\nIn other words, put your phone on a table somewhere away from all the chaos. Thatâ€™s the best way to ensure that a touchdown, spilled beer, or fit of rage doesnâ€™t leave your smartphone hurting after a big hit.', NULL, , 14246, 'super-bowl-298.jpg', 'image/jpeg', 0, '2013-02-04 15:52:11');
INSERT INTO `posts` (`id`, `title`, `body`, `modified_date`, `image_content`, `image_size`, `image_name`, `image_type`, `archive`, `created_date`) VALUES
(50, 'France Wonâ€™t Get LTE On The iPhone Before The End Of 2013 As The ARCEP Fails To Make A Decision', 'It keeps getting worse for French iPhone owners. The agency for telecommunications ARCEP has just announced that it would meet with the four French telcos to know if and when it should refarm Bouygues Telecomâ€™s 1,800MHz band to bring LTE to the iPhone 5. The three other companies are begging the ARCEP to wait until at least 2014 to start this process, effectively lobbying for slowing down innovation in this industry.\r\n\r\nLast July, Bouygues Telecom sent a request to the ARCEP to reuse its old 2G 1,800 MHz band for LTE communications. It would give a head start to the third largest telecommunications company. According to the French law, the ARCEP has up to eight months to reply.\r\n\r\nThatâ€™s why the agency finally explained what it plans to do in the coming months. On February 7th, the four telcos will have to present their arguments. Bouygues Telecom wanted to reuse its 1,800 MHz band in early 2013. It definitely looks like the ARCEP will miss the mark. Even though it first agreed with Bouygues Telecom, Free now wants to wait as long as possible as the company is already having a hard time laying out its 3G network and meeting ARCEPâ€™s coverage requirements.\r\n\r\nFinally, Orange and SFR are acting like spoiled children, begging the ARCEP to wait until the end of 2013 or even 2014 before even thinking about refarming the 1,800 MHz brand. In 2012, the two companies bought the so-called â€œgold spectrumâ€ in the 800 MHz band for around $1.6 billion (â‚¬1.2 billion). This band is effectively useless for the iPhone, many Samsung devices and many other brands as it only works with a few Android handsets, such as the HTC One XL and the Motorola Razr HD. It was overpriced.\r\n\r\nAll these companies are playing the job card as well. Delaying or refarming the 1,800 MHz band would create hundreds of jobs depending on which company you take side with. It will be a key argument for the ARCEP, even though the four companies are inflating those numbers.\r\n\r\nAllowing LTE plans sooner than later would enable the four telecommunication companies to increase the average data plan subscription price. As plan prices have greatly decreased recently, those companies desperately need a new steady influx of money to invest in optical fiber and other infrastructure improvements.', NULL, , 40854, '1625756107_32fa678d69.jpg', 'image/jpeg', 0, '2013-02-04 16:06:00');

